import React from "react";
import styled from "styled-components";
import {
  EducationDetail,
  FrameworkSkillContent,
  PersonalDetail,
  ProgrammingSkillContent,
  SoftSkillContent,
} from "../common/Content";
import Card from "../components/Card";
import ListCard from "../components/ListCard";

const SkillWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  margin-bottom: 16px;
`;

export default function Home() {
  return (
    <>
      <button
        onClick={window.scrollTo({
          top: document.body.scrollHeight,
          behavior: "smooth",
        })}
      >
        Test
      </button>
      <Card img="profile_picture.png" content={PersonalDetail} border />
      <SkillWrapper>
        <ListCard
          border
          contents={ProgrammingSkillContent}
          title="Programming Skill"
        />
        <ListCard
          border
          contents={FrameworkSkillContent}
          title="Framework Skill"
        />
        <ListCard border contents={SoftSkillContent} title="Soft Skill" />
      </SkillWrapper>
      <SkillWrapper>
        <ListCard
          title="Bachelor of Engineering"
          contents={EducationDetail}
          border
        />
        <ListCard title="Work Experiences" contents={EducationDetail} border />
      </SkillWrapper>
      <SkillWrapper>
        <ListCard
          border
          contents={ProgrammingSkillContent}
          title="Programming Skill"
        />
        <ListCard
          border
          contents={FrameworkSkillContent}
          title="Framework Skill"
        />
        <ListCard border contents={SoftSkillContent} title="Soft Skill" />
      </SkillWrapper>
    </>
  );
}
